import * as React from "react";
import { Button } from "@material-tailwind/react";
import FilterAltRoundedIcon from "@mui/icons-material/FilterAltRounded";
import AddCircleOutlineRoundedIcon from "@mui/icons-material/AddCircleOutlineRounded";

import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";

const test = () => {
  const bull = (
    <Box
      component="span"
      sx={{ display: "inline-block", mx: "2px", transform: "scale(0.8)" }}
    >
      â€¢
    </Box>
  );
  return (
    <div className="flex justify-center">
      <form action="" className="container">
        <div className="addProduct-navbar container flex  justify-between border shadow">
          <h4 className="text-2xl font-bold">Product Form</h4>
          <div className="navbar-button">
            <Button
              variant="contained"
              className="text-black bg-white-600 font-semibold p-2 px-4"
            >
              <FilterAltRoundedIcon />
              <span className="ml-2">Filter</span>
            </Button>
            <Button
              variant="contained"
              className="text-white bg-blue-600  font-semibold p-2 px-4"
            >
              <AddCircleOutlineRoundedIcon />
              <span className="ml-2">Create</span>
            </Button>
          </div>
        </div>
        <div className="form-items w-full flex justify-between">
          <div className="form-left w-80 border">
            <div className="card-thumbnail">
              <Card sx={{ minWidth: 275 }}>
                <CardContent></CardContent>
                <CardActions>
                  <Button size="small">Learn More</Button>
                </CardActions>
              </Card>
            </div>
          </div>
          <div className="form-right"></div>
        </div>
      </form>
    </div>
  );
};

export default test;
